import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Type 'iPhone' into the search input
    await page.fill('#searchInput', 'iPhone');

    // Take screenshot after typing
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_typed_iphone.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_typed_iphone.png'));

    // Wait for the search button (first visible one)
    const searchBtn = await page.waitForSelector('.search-btn', { timeout: 5000 });

    // Click the search button
    await searchBtn.click();

    // Wait for search results heading to appear
    await page.waitForSelector('h2', { timeout: 5000 });

    // Take screenshot of the results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract product titles from the results (limit to 5)
    const productTitles = await page.$$eval(
      '.product-title',
      nodes => nodes.slice(0, 5).map(n => n.textContent.trim())
    );

    // Extract the results count text
    let resultsCount = '';
    try {
      resultsCount = await page.$eval('.results-count', el => el.textContent.trim());
    } catch {}

    return {
      success: true,
      action: "Searched for 'iPhone' products and captured search results",
      extractedData: {
        resultsCount,
        productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
